INSERT INTO `contents` VALUES (2,'content-room','Our Rooms','The better you sleep, the better we are','At the 5-star Artichaut Hotel, every room is a promise of luxury and comfort. From the cozy standard room to the presidential suite fit for a head of state on holiday, our spaces blend elegance and refinement. Plush bedding, ultra-fast Wi-Fi, sumptuous bathrooms, and thoughtful little touches turn every stay into an enchanting escape. Whether you\'re here for business or leisure, get ready for an experience where every detail matters‚Ä¶ even the softness of the pillows!',1,0,NULL,'1',2,'2025-02-19 13:18:30','2025-02-24 09:45:43'),(4,'content-massage','Let\'s Massage !!','The best thai massage ever !!!','Our massages are an invitation to absolute relaxation. Whether it‚Äôs a soothing massage, a deep tissue treatment, or a hot stone therapy, every touch is designed to release your tension and immerse you in a sea of well-being. With expert hands and precious oils, your only challenge will be not to fall asleep too quickly‚Ä¶ but we won‚Äôt hold it against you!',1,0,NULL,'1',2,'2025-02-19 13:18:30','2025-02-24 09:47:28'),(5,'massage-content','Massages','Relachez, vous √™tes mass√©','Nos massages sont une invitation au l√¢cher-prise absolu. Qu‚Äôil s‚Äôagisse d‚Äôun modelage relaxant, d‚Äôun massage deep tissue ou d‚Äôun soin aux pierres chaudes, chaque pression est pens√©e pour d√©nouer vos tensions et vous plonger dans un oc√©an de bien-√™tre. Entre mains expertes et huiles pr√©cieuses, votre seul effort sera de ne pas vous endormir trop vite‚Ä¶ mais on ne vous en voudra pas !',1,1,NULL,'1',1,'2025-02-19 13:18:30','2025-02-21 07:13:49'),(6,'content-wine','Cheers !!!','You never taste it so French !!!','Our wine selection is a sensory journey through the finest terroirs. From bold reds to delicate whites, with a touch of festive bubbles, each bottle is carefully chosen to elevate your meals‚Ä¶ or simply for pure enjoyment. Let our sommeliers guide you, and may your only dilemma be choosing between a grand cru and a love at first sip. Cheers! üç∑',1,0,NULL,'1',2,'2025-02-19 13:18:30','2025-02-24 09:48:54'),(7,'wine-content','Nos Vins','Une selection, des plus reconnues au monde','Notre s√©lection de vins est un voyage sensoriel √† travers les plus beaux terroirs. Des rouges puissants aux blancs d√©licats, en passant par des bulles festives, chaque bouteille est choisie avec soin pour sublimer vos repas‚Ä¶ ou simplement pour le plaisir. Laissez nos sommeliers vous guider, et que votre seul dilemme soit de choisir entre un grand cru et un coup de c≈ìur. Sant√© ! üç∑',1,1,NULL,'1',1,'2025-02-19 13:18:30','2025-02-21 07:16:03'),(16,'banner-equipe','L\'Equipe','Pour votre service','L‚Äô√©quipe de l‚ÄôH√¥tel 5 √©toiles Artichaut, c‚Äôest une symphonie de talents au service de votre bien-√™tre. Chefs passionn√©s, sommeliers inspir√©s, th√©rapeutes aux mains de velours et concierges aux petits soins‚Ä¶ chaque membre de notre maison met son expertise et son sourire au c≈ìur de votre s√©jour. Forts d‚Äôann√©es d‚Äôexp√©rience dans les plus grandes maisons, ils anticipent vos envies et transforment chaque instant en un moment d‚Äôexception. Ici, l‚Äôexcellence n‚Äôest pas un simple mot, c‚Äôest une promesse.',1,0,NULL,'1',1,'2025-02-20 09:25:32','2025-02-24 10:04:04'),(17,'restaurant-banner','Restaurant','Savourez l\'excellence, o√π chaque moment devient une exp√©rience','Bienvenue dans notre restaurant, o√π l‚Äôart culinaire rencontre l‚Äôaudace v√©g√©tale ! Ici, l‚Äôartichaut est roi et s‚Äôinvite subtilement dans chaque menu, de l‚Äôentr√©e au dessert. Notre chef, v√©ritable maestro des saveurs, revisite ce tr√©sor gastronomique avec cr√©ativit√© et finesse, surprenant vos papilles √† chaque bouch√©e. Une cuisine raffin√©e, inventive et r√©solument inoubliable‚Ä¶ m√™me pour ceux qui pensaient ne pas aimer l‚Äôartichaut !',0,0,NULL,'0',1,'2025-02-24 11:57:45','2025-02-24 11:57:45'),(18,'restaurant-banner-en','Restaurant','Savor excellence, where every moment becomes an experience.','Welcome to our restaurant, where culinary artistry meets bold botanical flair! Here, the artichoke reigns supreme, making a subtle yet delightful appearance in every menu, from starter to dessert. Our chef, a true maestro of flavors, reinvents this culinary gem with creativity and finesse, surprising your taste buds at every bite. A refined, inventive, and truly unforgettable dining experience‚Ä¶ even for those who thought they didn‚Äôt like artichokes!',0,0,NULL,'0',2,'2025-02-24 11:59:38','2025-02-24 11:59:38'),(19,'equipe-banner-en','The Squad','At your sevice, Sir!!','The team at the 5-star H√¥tel Artichaut is a symphony of talent dedicated to your well-being. Passionate chefs, inspired sommeliers, skilled therapists with a delicate touch, and attentive concierges‚Äîeach member of our establishment brings expertise and a warm smile to make your stay unforgettable. With years of experience in the finest establishments, they anticipate your every need and turn each moment into an exceptional experience. Here, excellence is not just a word‚Äîit‚Äôs a promise.',0,0,NULL,'0',2,'2025-02-24 12:03:25','2025-02-24 12:07:56'),(21,'spa-banner-en','SPA','Escape to a sanctuary of serenity and absolute well-being.','Give your feet an extraordinary experience with our aquatic health trail, where graceful salmon take care of them‚Ä¶ in their own special way. Between gentle tickles and invigorating micro-massages, these synchronized swimming experts boost your circulation while bringing a few bursts of laughter. A treatment as unusual as it is effective, proving once again that well-being starts from the toes up! üêüüí¶',0,0,'spa','0',2,'2025-02-24 12:31:27','2025-02-25 12:35:52'),(22,'service-banner-fr','Services','Notre h√¥tel de luxe vous offre des services exclusifs tels que valet, pressing, voiturier et bien plus pour un s√©jour inoubliable','Profitez de nos services exclusifs con√ßus pour rendre votre s√©jour facile et agr√©able. De notre service de pack professionnel, o√π nous prenons soin de vos bagages comme si c‚Äô√©tait les n√¥tres, √† notre voiturier pour une arriv√©e sans tracas, nous avons pens√© √† tout. Besoin de rafra√Æchir vos v√™tements ? Notre service de blanchisserie s‚Äôen charge avec soin. Et pour vos compagnons √† quatre pattes, nous proposons un service de garde de chien, pour qu\'ils puissent aussi profiter de leurs vacances pendant que vous explorez. Chaque d√©tail, grand ou petit, est pris en charge pour garantir votre confort total. üêæ‚ú®',0,0,NULL,'0',1,'2025-02-24 12:42:51','2025-02-24 12:42:51'),(23,'service-banner-en','Services','Our luxury hotel offers exclusive services such as valet, laundry, concierge, and much more to ensure an unforgettable stay.','Indulge in our exclusive services designed to make your stay effortless and enjoyable. From our professional pack service, where we take care of your luggage as if it were our own, to our valet parking for a seamless arrival, we\'ve thought of everything. Need your clothes refreshed? Our laundry service is here to handle it with care. And for your furry friends, we offer dog sitting services, so they can enjoy their own little vacation while you\'re out exploring. Every detail, big or small, is taken care of to ensure your utmost comfort. üêæ‚ú®',0,0,NULL,'0',2,'2025-02-24 12:43:27','2025-02-24 12:43:27'),(24,'restaurant-cards-room','Les ambiances','Plusieurs ambiances, pour toute l\'ann√©e','Plongez dans une ambiance √©l√©gante et raffin√©e, o√π chaque d√©tail a √©t√© pens√© pour √©veiller vos sens. Lumi√®res tamis√©es, tables soigneusement dress√©es et une atmosph√®re feutr√©e cr√©ent le d√©cor id√©al pour une exp√©rience gastronomique inoubliable. Ici, chaque repas se savoure autant avec les yeux qu‚Äôavec le palais.',0,0,NULL,'0',1,'2025-02-24 14:58:51','2025-02-24 14:58:51'),(26,'banner-artichaut-fr','L\'Artichaut','Passez un s√©jour unique dans un hotel intimiste et chaleureux','√Ä l‚ÄôH√¥tel 5 √©to